import React from "react";

const Banner = props => {
  return (
    <div class='home-page'>
      <div class='banner'>
        <div class='container'>
          <h1 class='logo-font'>conduit</h1>
          <p>A place to share your knowledge.</p>
        </div>
      </div>
    </div>
  );
};

export default Banner;
